import React from 'react';
import { useState } from 'react';
import Login from './Login';

export  const SignUp =(props) =>{
    const{name, setName}=useState('');
    const{email, setEmail}=useState('');
    const{hostelname, setHostelName}=useState('');
    const{custodiancontact, setCustodianContact}=useState('');
    const{location, setLocation}=useState('');
    const{roomtype, setRoomType}=useState('');
    const{distance, setDistance}=useState('');
    const{price, setPrice}=useState('');
  
    const handleSubmit =()=>{
      email.preventDefault();
      console.log(email);
  }
  
  
    
    return (
      <div className='form-container'>
    <h2>SignUp</h2>
     <form  className='signup-form'onSubmit={handleSubmit} >
      <label htmlForfor='full name'>Full Name</label>
  <input value={name} onChange={(e) => setName(e.target.value)} type='name' placeholder='Full Name' name='name'></input>
  <label htmlForfor='hostelname'>Hostel Name</label>
   <input value={hostelname} onChange={(e)=> setHostelName(e.target.value)}type='hostelname' placeholder='Nana hostel' id='hostelname' name='hostelname'></input>
   <label htmlForfor='custodiancontact'>custodiancontact</label>
   <input value={custodiancontact} onChange={(e)=> setCustodianContact(e.target.value)}type='custodiancontact'  name='custodiancontact'></input>
   <label htmlForfor='location'>Location</label>
   <input value={location} onChange={(e)=> setLocation(e.target.value)}type='location'  name='location'></input>
   <label htmlForfor='roomtype'>Room Type</label>
   <input value={roomtype} onChange={(e)=> setRoomType(e.target.value)}type='room type'  name='roomtype'></input>
   <label htmlForfor='distance'>Distance</label>
   <input value={distance} onChange={(e)=> setDistance(e.target.value)}type='distance' name='distance'></input>
   <label htmlForfor='price'>Price</label>
   <input value={price} onChange={(e)=> setPrice(e.target.value)}type='price' name='price'></input>
   <button>SignUp</button>
     </form>
      <button className='link-btn'onClick={() =>props.onFormSwitch(Loginogin)}>Alread have an account? Login here.</button>  
      
      </div>
    );
  }
  
  
  

export default SignUp;
